function showGrid(num) {
    console.log(num);
    $('#gridModal').modal('show');
    $("#gridTrackName").html("");
    $("#innerInfoText").html("");
    $("#gridBody").html("");
    $("#gridAudio").html("");
    $("#songInfoButton").html('Note for Nat');
    $("#songModalLabel").html("Guess the song?")

    const height = 16;
    const width = 16;
    const astro = grids[num-1];

    let inner = "";

    $("#songInfoButton").attr("onclick","showInfo("+num+")");

    for (let i = 0; i < height; i++) {
        let row = "<div class='text-center'>";
        for (let j = 0; j < width; j++) {
            let lesser = (i <= j) ? j : i;
            row = row + '<span class="small-square flipper-' + lesser + '" style="background-color:' + astro[i][j] + '"></span>';
        }
        row = row + "</div>";
        inner = inner + row;
        
    }
    inner = inner + '<div class="text-center spotifyCodes fromtop"><img src="SongCodes/' + num +'.png" alt="Spotify Playlist Code" width="200" height="50"></div>'
    $("#gridBody").html(inner);
}


function showInfo(num) {
    $("#songModalLabel").html("A little info");
    $("#songInfoButton").html('Back to Song');
    $("#songInfoButton").attr("onclick","showGrid("+num+")");
    $("#gridBody").html("");
    $("#gridTrackName").html(songNames[num-1]);
    var password = localStorage.getItem("auth");
    var decrypted = CryptoJS.AES.decrypt(notesEnc[num], password);
    var decryptedString = decrypted.toString(CryptoJS.enc.Utf8);
    $("#innerInfoText").html(decryptedString);
    $("#gridAudio").html('<div class="text-center"><audio controls><source src="Songs/'+ num +'.mp3" type="audio/mpeg">Your browser does not support the audio element.</audio></div>');

}





